var styles = {
  background: {
    marginTop: '10%'

  }
};


class App extends Component {
    render() {
        return (
          <div className='container' style={styles.background}>
            <Appliance />
            <Furn />
            <Ent />


          </div>
        );
      }
}

export default Radium(App);
